import React, { Component } from 'react';
import TodoItem from './todoitem';

class TodoBody extends Component {
  render() {
    let { data } = this.props;
    return (
      <div className="todos__body">
      {data.map}
        <TodoItem/>
      </div>
    );
  }

}

export default TodoBody;
